import React from "react";

const Blog=(state)=>{

const {items,Edit,DeleteItem}=state;



    const man=  items.map(item=>{
      
      <div key="item.id" className='adding_item'>

      <form type="submit">
       {item.name} 
    
     <button onClick={Edit}>Edit Course</button>
    
        
    <button onClick={DeleteItem}>Delete Item</button>
      </form>
      </div>   
      })
  return(
<div key={items.id}>
  {man}
</div>
  )     

}
export default Blog;
